import React from "react";
import {Modal} from 'antd';

import "../dashboard.css";


 function Assetimage ({openModal, onModalClose, row}){
    console.log("row", row);
    return (
        <Modal
        open={openModal}
        title="Asset Details"
        // onOk={handleOk}
        onCancel={onModalClose}

        >
            <div>
                <p>{row.name}</p>
            </div>

      </Modal>
    );

};
export default Assetimage;
